import React, { useState } from 'react';

const ExaDeAdmisRequViewPage = () => {
    const [searchTerm, setSearchTerm] = useState('');
    const [selectedCourse, setSelectedCourse] = useState('');
    const [selectedYear, setSelectedYear] = useState('');
    const [selectedExam, setSelectedExam] = useState('');
    const [selectedSemester, setSelectedSemester] = useState('');
    const [selectedBatch, setSelectedBatch] = useState('');
    const [selectedStatus, setSelectedStatus] = useState('');
    const [tableData, setTableData] = useState([]);
  
    // Function to handle form submission when Add button is clicked
    const handleAdd = () => {
      // Implement your logic to add a new entry to the tableData array
      const newEntry = {
        Date: '2023-07-19',
        Course: selectedCourse,
        Exam: selectedExam,
        Year: selectedYear,
        Semester: selectedSemester,
        Batch: selectedBatch,
        Status: selectedStatus,
        Description: 'Sample description',
      };
  
      setTableData([...tableData, newEntry]);
  
      // Reset form fields after adding new entry
      setSelectedCourse('');
      setSelectedExam('');
      setSelectedYear('');
      setSelectedSemester('');
      setSelectedBatch('');
      setSelectedStatus('');
    };
  
    return (
      <div>
        <h2>Search and Filter</h2>
        <div>
          {/* Search bar and dropdowns go here */}
          <button onClick={handleAdd}>Add</button>
        </div>
  
        <h2>Table</h2>
        <table>
          <thead>
            <tr>
              <th>Date</th>
              <th>Course</th>
              <th>Exam (end/mid)</th>
              <th>Batch</th>
              <th>Year</th>
              <th>Semester</th>
              <th>Status</th>
              <th>Action</th>
              <th>Description</th>
            </tr>
          </thead>
          <tbody>
            {tableData.map((row, index) => (
              <tr key={index}>
                <td>{row.Date}</td>
                <td>{row.Course}</td>
                <td>{row.Exam}</td>
                <td>{row.Batch}</td>
                <td>{row.Year}</td>
                <td>{row.Semester}</td>
                <td>{row.Status}</td>
                <td>{row.Action}</td>
                <td>{row.Description}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };
  

export default ExaDeAdmisRequViewPage;
